  const REPS = ["Anders Larsen", "Cane Byers", "Cody Bearden", "Dustin Welch", "Elijah Montoya", "Ethan Gill", "Gregorio Frias", "HALL_1", "Holden Erstad", "Jeremy Boucher", "John Perea", "Jordan Lopez", "Jorge Espinoza", "Josh Johnston", "Joshua Jordan", "Mark Hall", "Phil Lucero", "Rick Duran"];

  // Basemaps
  const esriImagery = L.esri.basemapLayer('Imagery');
  const osmStreets = L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', { maxZoom: 19, attribution: '&copy; OpenStreetMap contributors' });
  const esriStreets = L.esri.basemapLayer('Streets');

  const map = L.map('map', { layers: [esriImagery] }).setView([35.188455275318255, -106.58613496142884], 7);
  L.control.layers({ 'ESRI Satellite': esriImagery, 'OSM Streets': osmStreets, 'ESRI Streets': esriStreets }, null, { collapsed: false }).addTo(map);

  let clusterSupported = (typeof L.markerClusterGroup === 'function');
  let clusterLayer = clusterSupported ? L.markerClusterGroup() : L.layerGroup();
  let plainLayer = L.layerGroup();
  let heatLayer = null;

  const repSelect = document.getElementById('repSelect');
  const selectAllReps = document.getElementById('selectAllReps');
  const statusFilter = document.getElementById('statusFilter');
  const toggleCluster = document.getElementById('toggleCluster');
  const toggleHeat = document.getElementById('toggleHeat');
  const toggleDots = document.getElementById('toggleDots');

  function populateReps() {
    repSelect.innerHTML = '';
    REPS.forEach(rep => {
      const opt = document.createElement('option');
      opt.value = rep; opt.textContent = rep; opt.selected = selectAllReps.checked;
      repSelect.appendChild(opt);
    });
  }
  populateReps();

  function getSelectedReps() {
    if (selectAllReps.checked) return REPS.slice();
    return Array.from(repSelect.selectedOptions).map(o => o.value);
  }

  function isSold(rec) { return (rec.result || '').trim() === 'Sold'; }
  function isNotSold(rec) { return !isSold(rec); }

  function popupHtml(rec) {
    var priceVal = rec.price != null ? new Intl.NumberFormat('en-US', {style:'currency', currency:'USD'}).format(rec.price) : '—';
    return '<div style="font-size:12px;">'
      + '<div><strong>' + (rec.prospect || '') + '</strong></div>'
      + '<div>' + (rec.address || '') + '</div>'
      + '<div>Date: ' + (rec.date || '') + '</div>'
      + '<div>Rep: ' + (rec.rep || '') + '</div>'
      + '<div>Result: ' + (rec.result || '') + '</div>'
      + '<div>Sold Price: ' + priceVal + '</div>'
      + '</div>';
  }

  function rebuild() {
    clusterLayer.clearLayers();
    plainLayer.clearLayers();
    if (heatLayer) { heatLayer.remove(); heatLayer = null; }

    const selectedReps = getSelectedReps();
    const status = statusFilter.value;

    const markerRecords = DATA.filter(rec => (
      (selectedReps.length === 0 || selectedReps.includes(rec.rep)) &&
      (status === 'all' || (status === 'sold' ? isSold(rec) : isNotSold(rec)))
    ));

    markerRecords.forEach(rec => {
      const color = isSold(rec) ? '#FF00FF' : '#FFFF00';
      const marker = L.circleMarker([rec.lat, rec.lng], { radius: 6, color: '#555', weight: 1, fillColor: color, fillOpacity: 0.9 }).bindPopup(popupHtml(rec));
      clusterLayer.addLayer(marker);
      plainLayer.addLayer(marker);
    });

    // Heatmap: ALL results
    const heatRecords = DATA.filter(rec => (selectedReps.length === 0 || selectedReps.includes(rec.rep)));
    if (heatRecords.length && typeof L.heatLayer === 'function') {
      const points = heatRecords.map(rec => [rec.lat, rec.lng, 0.7]);
      heatLayer = L.heatLayer(points, {radius: 25, blur: 15, maxZoom: 17});
    }

    if (toggleDots.checked) {
      if (toggleCluster.checked && clusterSupported) {
        if (!map.hasLayer(clusterLayer)) map.addLayer(clusterLayer);
        if (map.hasLayer(plainLayer)) map.removeLayer(plainLayer);
      } else {
        if (!map.hasLayer(plainLayer)) map.addLayer(plainLayer);
        if (map.hasLayer(clusterLayer)) map.removeLayer(clusterLayer);
      }
    } else {
      if (map.hasLayer(clusterLayer)) map.removeLayer(clusterLayer);
      if (map.hasLayer(plainLayer)) map.removeLayer(plainLayer);
    }

    if (toggleHeat.checked && heatLayer) { heatLayer.addTo(map); }

    const activeLayer = (toggleCluster.checked && clusterSupported) ? clusterLayer : plainLayer;
    try {
      const bounds = activeLayer.getBounds();
      if (bounds && bounds.isValid()) { map.fitBounds(bounds.pad(0.05)); }
    } catch(e) { /* ignore */ }
  }

  toggleCluster.addEventListener('change', rebuild);
  toggleHeat.addEventListener('change', rebuild);
  toggleDots.addEventListener('change', rebuild);
  statusFilter.addEventListener('change', rebuild);

  selectAllReps.addEventListener('change', () => { populateReps(); rebuild(); });
  repSelect.addEventListener('change', rebuild);

  rebuild();
} catch (e) {
  console.error(e);
  showError('Unexpected script error: ' + e.message);
}
